<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Document</title>
</head>
<body>
<div style="background-color: black">
    <img
        src="data:image/png;base64,"
        alt=""
        width="150"
    >
</div>
<div style="padding-top: 20px; padding-bottom: 20px">
    <p style="font-size: 18px">
        Hi {{$ticket->attendee->customer->full_name}},
        <br> <br>
        We are excited to let you know that you have successfully bought a tickets
        for {{$ticket->ticket->event->title}}. by
        {{$ticket->ticket->event->user->buisness_name}}

    </p>
</div>

<div style="padding-top: 20px; padding-bottom: 20px">
    <h1>Ticket details</h1>
    <div>
        <p style="margin: 2px">#{{$ticket->id}}</p>
        <h3 style="margin: 2px">Ticket Number</h3>
    </div>
    <br>
    <div>
        <p style="margin: 2px">{{$ticket->ticket->event->location}}</p>
        <h3 style="margin: 2px">Event location</h3>
    </div>
    <br>
    <div>
        <p style="margin: 2px">{{$ticket->price}}</p>
        <h3 style="margin: 2px">Ticket price</h3>
    </div>
    <br>
    <div>
        <p style="margin: 2px">{{$ticket->quantity}}</p>
        <h3 style="margin: 2px">Ticket quantity</h3>
    </div>
    <br>
    <div>
        <p style="margin: 2px; text-transform: uppercase">{{$ticket->invoice->payment_method}}</p>
        <h3 style="margin: 2px">Payment method</h3>
    </div>
    <br>
    <div>
        <p style="margin: 2px; text-transform: uppercase">{{$ticket->created_at->format('d/m/Y')}}</p>
        <h3 style="margin: 2px">Date purchased</h3>
    </div>
    <br>
    <div>
        <p style="margin: 2px; text-transform: uppercase">{{$ticket->created_at->format('H:i:s')}}</p>
        <h3 style="margin: 2px">Time purchased</h3>
    </div>
</div>
<br>
<img src="{{$qrCode}}" width="200" height="200" alt="">
</body>
</html>
